import React from "react";

import "./Project.css";

import Media from "react-bootstrap/Media";

const project = props => (
  <Media as="li">
    <img
      width={64}
      height={64}
      className="project__image"
      className="mr-3"
      src={props.image}
      alt={props.title}
    />
    <Media.Body>
      <h5>{props.title}</h5>
      <p>{props.explanation}</p>
    </Media.Body>
  </Media>
);

export default project;
